// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";


/**
 * @title TuliaToken
 * @dev Extension of the OpenZeppelin ERC20 and AccessControl contracts.
 * Allows for the minting and burning of tokens by addresses with the appropriate roles.
 */
contract TuliaToken is ERC20 {

    /// Custom error for better gas efficiency and clarity
    error Unauthorized();

    constructor(string memory name, string memory symbol, address admin) ERC20(name, symbol) {
        if (admin == address(0)) revert Unauthorized(); // Ensure admin address is not zero


    }

    /**
     * @dev Mints `amount` tokens to the `to` address. Only callable by accounts with the MINTER_ROLE.
     *
     * Requirements:
     * - the caller must have the `MINTER_ROLE`.
     */
    function mint(address to, uint256 amount) public  {
        if (to == address(0)) revert Unauthorized(); // Ensure minting address is not zero
        _mint(to, amount);
    }

    /**
     * @dev Burns `amount` tokens from the caller's account, reducing the total supply.
     *
     * Requirements:
     * - the caller must have a balance of at least `amount`.
     */
    function burn(uint256 amount) public {
        _burn(_msgSender(), amount);
    }
}

